const desserts = [
  {
    id: 0,
    image: require('src/assets/cupcake.png'),
    type: 'Choclate',
    name: 'Cupcake',
    price: '$2.99',
    description: 'Choclate Cup cake',
  },
  {
    id: 1,
    image: require('../../../assets/donuts.png'),
    type: 'Chocolate',
    name: 'Chocolate donuts',
    price: '$2',
    description: 'Chocolate donuts',
  },
  {
    id: 2,
    image: require('../../../assets/ice_cream.png'),
    type: 'vanilla',
    name: 'Ice cream vanilla',
    price: '$1',
    description: 'Vanilla Ice cream',
  },
  {
    id: 3,
    image: require('../../../assets/macarons.png'),
    type: 'marshmello',
    name: 'Macarons',
    price: '$3',
    description: 'French macaron recipe',
  },
  {
    id: 4,
    image: require('../../../assets/choclate.png'),
    type: 'Chocolate',
    name: 'Chocolate with almonds',
    price: '$2.99',
    description: 'Chocolate with almonds',
  },
];
export default desserts;
